import React from "react";
import Header from "./header.jsx";
import Footer from "./footer.jsx";
import Note from "./note.jsx";

function App() {
  return (
    <div>
      <Header />
      <Note key={Note.id} title={Note.title} content={Note.content} />
      <Footer />
    </div>
  );
}

export default App;
